import React  from "react";
import './D.css';


const AddNew = (props) => {

    return (
        <div > 
            <div>
                <div>
                    <h3 className="headd">{props.head}</h3>
                    <hr />
                </div>
                <div className="addC">
                    <div>
                        <label for="documentNo">Description</label>
                        <input type="text" id="documentNo" name="documentNo" value="Auto Number"/>
                    </div>
                </div>
                <div>
                    <div className="addC addc">
                        <button className="btn1">Save</button>
                    </div>
                </div>
            </div>
        </div>
    );
}


export default AddNew;
